import Awarddata from "./Awarddata";

import AwardCard from "./AwardCard";
function Awards() {
    return (<>

        <div className="container-fluid  Award mt-5  ">
            <div className="row d-flex justify-conten-center ">

                <div className="col-sm-10 mx-auto ">

                    <div className="">
                        <h1 className="heading text-center mt-5 text-light">Awards</h1>
                    </div>

                </div>

                <div className="col-sm-10 mx-sm-auto ">
                    <div className="row d-flex  gy-3 flex-nowrap overflow-auto p-5 ">
                    {
                      Awarddata.map((val,ind)=>{
                        return <AwardCard date={val.date} imgsrc={val.imgsrc} para={val.para}/>
                      })}
                    </div>


                </div>
            </div>
        </div>
    </>);
}

export default Awards;
